import Intro from "./components/intro/intro";
import About from "./components/about/about";
import Navbar from "./components/navbar/navbar";
import { Route } from "react-router-dom";

const App = () => {
  return (
    <div>
      <Navbar />
      <Route path="/" component={Intro} />
      <About />
    </div>
  );
};

export default App;
